import React from 'react'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './pages/Login'
import { AuthProvider } from './context/AuthContext';

function App() {
  return (
    <AuthProvider>
    <Router>
      <div classname='app'>
        <Routes>
          <Route path='/' element={<Login />}/>

        </Routes>
      </div>
    </Router>
    </AuthProvider>
  );
}

export default App;
